 *
 * @author Renbowen
 * @date 2020-09-25
 */
@Getter
@Setter
@ToString
@AllArgsConstructor
@NoArgsConstructor
@Builder
public class ApiAccount extends BaseEntity {
    private static final long serialVersionUID = 1L;

    /**
     * 用户id
     */
    private String accountId;

    private String parentId;

    /**
     * 用户手机号
     */
    @Excel(name = "用户手机号")
    private String phone;

    /**
     * 微信openid
     */
    @Excel(name = "微信openid")
    private String wxOpenid;

    /**
     * 小程序授权登录返回值
     */
    @Excel(name = "小程序授权登录返回值")
    private String sessionKey;

    /**
     * 头像
     */
    @Excel(name = "头像")
    private String headPortrait;

    /**
     * 昵称
     */
    @Excel(name = "昵称")
    private String nickName;

    /**
     * 性别（1男2女0未知）
     */
    @Excel(name = "性别", readConverterExp = "1=男,2=女,0=未知")
    private Integer sex;

    /**
     * 生日
     */
    @Excel(name = "生日")
    private String birthday;
    
       /** 我的邀请码 */
    @Excel(name = "我的邀请码")
    private String myInvitationCode;

    /** 简介 */
    @Excel(name = "简介")
    private String briefIntroduction;
    
    /** 背景图片 */
    @Excel(name = "背景图片")
    private String backgroundImage;
    
    /** 实名认证标识 -1：未认证 0：审核中 1：已通过 2：已拒绝 */
    private Integer accountAuthenticationStatus;
    
    /** 企业认证标识 -1：未认证 0：审核中 1：已通过 2：已拒绝 */
    private Integer companyAuthenticationStatus;
    type  1 普通用戶 2  會員
